const UsrT = document.getElementById('UserTime')
function UsrLive() {
	UsrT.textContent = new Intl.DateTimeFormat('ms-MY', {
		formatMatcher: 'basic',
		weekday: 'long',
		day: 'numeric',
		month: 'short',
		year: 'numeric',
		hour: 'numeric',
		minute: '2-digit',
		second: '2-digit',
		fractionalSecondDigits: 3,
		dayPeriod: 'narrow',
		timeZoneName: 'shortGeneric',
		hour12: false,
		timeZone: UserTZ,
	}).format(new Date())
}
setInterval(UsrLive, 1)
const UTC = document.getElementById('ZuluTime')
function utcLive() {
	UTC.textContent = new Intl.DateTimeFormat('en-MY', {
		formatMatcher: 'basic',
		weekday: 'long',
		day: 'numeric',
		month: 'short',
		year: 'numeric',
		hour: 'numeric',
		minute: '2-digit',
		second: '2-digit',
		fractionalSecondDigits: 3,
		timeZoneName: 'short',
		hour12: false,
		timeZone: 'UTC',
	}).format(new Date())
}
setInterval(utcLive, 1)
